import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import NavBar from './Nav';
import Login from './Login';
import Game from './game';
import Level from './Level';
import Register from './Register';
import Profile from './Profile';
import Leaderboard from './Leaderboards';
import Stats from './Stats';
import GameLevelTwo from './GameLevelTwo';
import { BackgroundProvider } from './BackgroundContext'; // Import BackgroundProvider

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Render BackgroundProvider for pages where background should change */}
        <Route
          path={['/levels', '/game', '/profile', '/leaderboard', '/stats', '/gametwo']}
          element={
            <BackgroundProvider>
              <NavBar />
              <Route path="/levels" element={<Level />} />
              <Route path="/game" element={<Game />} />
              <Route path="/profile" element={<Profile />} />
              <Route path="/leaderboard" element={<Leaderboard />} />
              <Route path="/stats" element={<Stats />} />
              <Route path="/gametwo" element={<GameLevelTwo />} />
            </BackgroundProvider>
          }
        />

        {/* Render Login and Register without BackgroundProvider */}
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
      </Routes>
    </Router>
  );
};

export default App;
